import React, { useState, useEffect } from "react";
import { Box, Button, Typography, Card, CardContent, CircularProgress, Grid } from "@mui/material";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from "recharts";

function DiagnosisPage() {
  const navigate = useNavigate();
  const [diagnosis, setDiagnosis] = useState([]);
  const [chartData, setChartData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDiagnosisData = async () => {
      try {
        const diagnosisResponse = await axios.get("http://127.0.0.1:5000/diagnose");
        setDiagnosis(diagnosisResponse.data.diagnosis || []);
        const chartResponse = await axios.get("http://127.0.0.1:5000/trend_chart");
        setChartData(chartResponse.data); // Ensure backend provides JSON data for trend_chart
      } catch (err) {
        console.error("Error fetching diagnosis data:", err);
        setError("Failed to fetch data.");
      } finally {
        setLoading(false);
      }
    };

    fetchDiagnosisData();
  }, []);

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" height="100vh">
        <CircularProgress />
        <Typography ml={2}>Loading diagnosis...</Typography>
      </Box>
    );
  }

  if (error) {
    return (
      <Box display="flex" flexDirection="column" alignItems="center" mt={4}>
        <Typography color="error" variant="h6">{error}</Typography>
        <Button variant="contained" onClick={() => navigate("/")}>
          Back to Chat
        </Button>
      </Box>
    );
  }

  return (
    <Box p={4}>
      {/* Back Button */}
      <Button variant="outlined" color="primary" onClick={() => navigate("/")}>
        Back to Chat
      </Button>

      {/* Diagnosis Header */}
      <Typography variant="h4" mt={4} gutterBottom>
        Mental Health Diagnosis
      </Typography>

      {/* Diagnosis Cards */}
      <Grid container spacing={3}>
        {diagnosis.map((item, index) => (
          <Grid item xs={12} md={6} key={index}>
            <Card sx={{ backgroundColor: "#f3f4f6", boxShadow: 3 }}>
              <CardContent>
                <Typography variant="h5" color="primary">
                  {item.condition}
                </Typography>
                <Typography variant="body1" mt={2}>
                  Confidence: {item.confidence}%
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Trends Header */}
      <Typography variant="h5" mt={6} gutterBottom>
        Severity Trends
      </Typography>

      {/* Line Chart */}
      <Box mt={4} display="flex" justifyContent="center">
        <LineChart width={800} height={400} data={chartData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="timestamp" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="trend_score" stroke="#8884d8" strokeWidth={2} />
        </LineChart>
      </Box>
    </Box>
  );
}

export default DiagnosisPage;
